import React, { useEffect, useState } from "react";
import axios from "axios";


function Trips(){
    const dbTable = 'trip_tbl'
    const [response, setResponse] = useState([])
    useEffect(() => {
        axios.post("/api/get-trip-items", dbTable).then(res =>{
            setResponse(res.data);
        })
    }, [])
    return(
        <>
            <table className="table">
                <thead>
                    <tr>
                        <th>Trip Name</th>
                        <th>Trip Fare</th>
                        <th>Trip Date</th>
                        <th>Trip Vehicle</th>
                        <th>Trip Driver</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        {
                            response.map(trip =>
                                <>
                                <td>{trip.trip_from} To {trip.trip_to}</td>
                                <td>#{trip.trip_fare}</td>
                                <td>{trip.trip_date}</td>
                                <td>{trip.trip_vehicle}</td>
                                <td>{trip.trip_driver}</td>
                                </>
                            )
                        }
                    </tr>
                </tbody>
            </table>
        </>
    )
}

export default Trips;
